import { useState } from 'react'


const NoteApp = () => {
  const [notes, setNotes] = useState([])
  const [title, setTitle] = useState('')


  return (
    <div>
      <h1>Notes</h1>
      <input onChange={() => {
        setTitle(e.target.value)}} value={title}></input>

    </div>
  )
}

export default NoteApp
